    if (isBg) {
        cy.get("[data-testid=\"AddCheckEntry-DropDown-".concat(fieldName, "-bg-select-container-icon-wrapper-icon-container\"]")).click();
    }
    else {
        cy.get("[data-testid=\"AddCheckEntry-DropDown-".concat(fieldName, "-select-container-icon-wrapper-icon-container\"]")).click();
    }
    cy.wait(waitTime);
    cy.get("[data-testid=\"AddCheckEntry-DropDown-".concat(fieldName, "-list-box\"]")).as("".concat(fieldName));
    cy.get("@".concat(fieldName)).find('p').contains(value).click();
};
